import React from 'react'

export const User = (props) => {
  console.log('User component props')
  console.log(props)
  if (!props.user) {
    return null
  }
  const usersBlogs = props.blogs.filter(blog => blog.user === props.user.id)
  return (
    <div>
      <h2>Blogs added by {props.user.name}</h2>
      <ul>{usersBlogs.map(blog => <li key={blog.id}>{blog.name}</li>)}</ul>
    </div>
  )
}
